=== ANALYSIS ===
Looking at this problem, I need to find all numbers with sequential digits within a given range.

Let me analyze:
1. **Problem Type**: Number generation, enumeration
2. **Key Patterns**: Generate all valid sequential digit numbers, filter by range
3. **Constraints**: With high <= 10^9, we only need to consider numbers up to 9 digits
4. **Edge Cases**: Different digit lengths, boundary values
5. **Input/Output**: Two integers (low, high) → sorted list of integers
6. **Difficulty**: The challenge is efficiently generating only valid sequential numbers

**Approach**: Since sequential digits are limited (only starting digits 1-9 and lengths 2-9), I can generate all possible sequential digit numbers and filter those in range.

For each starting digit (1-9) and each possible length, I can construct sequential numbers:
- Start with digit d, length l: d, d+1, d+2, ..., d+l-1
- This is valid only if d+l-1 <= 9

